import React from 'react';

export default function Skills() {
  return (
<div className='content'>
    <h3>Skills!</h3>
    <div className='container'>
        <div className='row'>
            <div className='col'>
                <img src={'./assets/Icons/html-t-96.png'} alt='HTML5' />
            </div>
        </div>
    </div>
</div>
  )
};
